    BusinessUserManager.prototype.getOrgGrpActionLimit = function(params, companyList, presentationSuccess, presentationError) {
        var infinityUser = kony.mvc.MDAApplication.getSharedInstance().getRepoManager().getRepository("InfinityUser");
        var scope = this;
        this.addLocaleHeader(infinityUser);
        infinityUser.customVerb('GetListCoreCustomerFeatureActionLimits', params, getAllCompletionCallback);

        function getAllCompletionCallback(status, data, error) {
            var srh = applicationManager.getServiceResponseHandler();
            var obj = srh.manageResponse(status, data, error, presentationSuccess, presentationError);
            if (obj["status"] === true) {
                for (var i = 0; i < obj["data"].LoopDataset.length; i++) {
                    if (obj.data.LoopDataset[i].dbpErrCode !== undefined) {
                        presentationError(obj.data.LoopDataset[i].dbpErrMsg);
                        return;
                    }
                }
                presentationSuccess(params.coreCustomerId, params.roleId, obj["data"].LoopDataset, companyList);
            } else {
                presentationError(obj["errmsg"]);
            }
        }
    };
